import React, { useEffect } from "react";
import RocketCards from "../Cards/RocketCards";

const CatalogPage = ({ rockets }) => {
  useEffect(() => {
    console.log("Rockets in CatalogPage:", rockets);
  }, [rockets]);

  if (rockets.length === 0) {
    return <p>Loading...</p>;
  }

  return (
    <div className="catalog-page">
      <h1>Rocket Catalog</h1>
      <RocketCards rockets={rockets} />
    </div>
  );
};

export default CatalogPage;
